import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import React from 'react';
import logo from './logo.svg';
import './App.css';
import Counter from './Counter';

function App() {
  return (
    <div className="App">
      <header className="App-header">

               <Router>
               <Link to="/Counter">Counter</Link>
               </Router>

      </header>


    </div>
  );
}


export default App;
